import React from "react";
import { Image, Pressable, Text, View } from 'react-native';

import { ItemCardProps } from "../interfaces/ItemCard.types";

export default function ItemCard(props: ItemCardProps) {
    const getRarityImage = (rarity: string): string | undefined => {
        //if      (rarity == 'C') return 'https://media.pokemoncentral.it/wiki/e/eb/Rarita_Comune.png';
        if (rarity == 'C') return 'data:image/png;base64,';
        //else if (rarity == 'U') return 'https://media.pokemoncentral.it/wiki/3/3b/Rarita_Non_comune.png';
        else if (rarity == 'U') return 'data:image/png;base64,';
        //else if (rarity == 'R') return 'https://media.pokemoncentral.it/wiki/2/2f/Rarita_Rara.png';
        else if (rarity == 'R') return 'data:image/png;base64,';
        else if (rarity == 'RH') return 'https://media.pokemoncentral.it/wiki/f/fb/Rarita_Olografica_rara.png';
        else if (rarity == 'RR') return 'https://media.pokemoncentral.it/wiki/5/52/Rarita_Double_Rare.png';
        //else if (rarity == 'IR') return 'https://media.pokemoncentral.it/wiki/a/aa/Rarita_Illustration_Rare.png';
        else if (rarity == 'IR') return 'data:image/png;base64,';
        else if (rarity == 'UR') return 'https://media.pokemoncentral.it/wiki/thumb/8/84/Rarita_Ultra_Rare.png/800px-Rarita_Ultra_Rare.png';
        else if (rarity == 'SIR') return 'https://media.pokemoncentral.it/wiki/2/27/Rarita_Special_Illustration_Rare.png';
        else if (rarity == 'MHR') return 'https://media.pokemoncentral.it/wiki/thumb/5/52/Rarita_Mega_Hyper_Rare.png/800px-Rarita_Mega_Hyper_Rare.png';
        else return undefined
    }

    const getTypeImage = (type: string): string | undefined => {
        if (type === 'colorless') return 'https://media.pokemoncentral.it/wiki/thumb/e/e2/Icona_Incolore_GCC.png/20px-Icona_Incolore_GCC.png';
        else if (type === 'dark') return 'https://media.pokemoncentral.it/wiki/thumb/2/25/Icona_Oscurit%C3%A0_GCC.png/20px-Icona_Oscurit%C3%A0_GCC.png';
        else if (type === 'dragon') return 'https://media.pokemoncentral.it/wiki/thumb/4/42/Icona_Drago_GCC.png/20px-Icona_Drago_GCC.png';
        else if (type === 'electric') return 'https://media.pokemoncentral.it/wiki/thumb/c/c2/Icona_Lampo_GCC.png/20px-Icona_Lampo_GCC.png';
        else if (type === 'fairy') return 'https://media.pokemoncentral.it/wiki/thumb/7/7f/Icona_Folletto_GCC.png/20px-Icona_Folletto_GCC.png';
        else if (type === 'fighting') return 'https://media.pokemoncentral.it/wiki/thumb/9/9f/Icona_Lotta_GCC.png/20px-Icona_Lotta_GCC.png';
        else if (type === 'fire') return 'https://media.pokemoncentral.it/wiki/thumb/e/e0/Icona_Fuoco_GCC.png/20px-Icona_Fuoco_GCC.png';
        else if (type === 'grass') return 'https://media.pokemoncentral.it/wiki/thumb/2/2b/Icona_Erba_GCC.png/20px-Icona_Erba_GCC.png';
        else if (type === 'psychic') return 'https://media.pokemoncentral.it/wiki/thumb/f/f9/Icona_Psiche_GCC.png/20px-Icona_Psiche_GCC.png';
        else if (type === 'steel') return 'https://media.pokemoncentral.it/wiki/thumb/c/c3/Icona_Metallo_GCC.png/20px-Icona_Metallo_GCC.png';
        else if (type === 'water') return 'https://media.pokemoncentral.it/wiki/thumb/b/bc/Icona_Acqua_GCC.png/20px-Icona_Acqua_GCC.png';
        else if (type === 'trainer') return 'data:image/png;base64,';
        else if (type === 'support') return 'data:image/png;base64,';
        else if (type === 'instrument') return 'data:image/png;base64,';
        else if (type === 'stadium') return 'data:image/png;base64,';
        else if (type === 'pokmon item') return 'data:image/png;base64,';
        else return undefined;
    }

    return (
        <View className="flex-1 min-h-20 overflow-hidden">

            <View
                className={`m-2 border-2 rounded-xl 
                    ${(Number(props.item.id) <= props.expansion.regularCards) ?
                        'bg-blue-500/40 border-blue-900' :
                        'bg-yellow-400/40 border-yellow-200'}`}>

                <Pressable className="flex justify-center items-center" onPress={() => props.onSelectCard(props.index, props.item)}>

                    <View className="bg-cyan-900/40 p-1 rounded-t-lg w-[100%] mb-2 flex-row justify-between items-center">

                        <Image
                            source={{ uri: getRarityImage(props.item.rarity) }}
                            style={{ width: 20, height: 20, marginStart: 10 }}
                            resizeMode='contain'
                        />

                        <Text className="font-robotomono text-white">{props.item.id + '/' + String(props.expansion.regularCards).padStart(3, '0')}</Text>

                        <Image
                            source={{ uri: getTypeImage(props.item.type.toLowerCase()) }}
                            style={{ width: 20, height: 20, marginStart: 10 }}
                            resizeMode='contain'
                        />

                    </View>

                    <Image
                        source={{ uri: props.item.image ? props.item.image : 'https://media.pokemoncentral.it/wiki/1/17/Cardback.jpg' }}
                        style={{ width: '100%', height: 150 }}
                        resizeMode='contain'
                    />

                    <Text className="font-bold text-center bg-yellow-700/80 text-white p-1 rounded-b-lg w-[100%] mt-2">{props.item.name}</Text>

                </Pressable>

            </View>

        </View>
    );
}